import React from 'react';
import NavigationBar from './NavigationBar.js'

class App extends React.Component {
   constructor() {
     super()
     this.state = {}
   }

   render() {
     return (
       <div>
         <h1>See or Skip?</h1>
         <NavigationBar />
       </div>
     )
   }
}

export default App;
